CREATE TABLE timeseries(
    stateid          VARCHAR(4),
    series           TEXT
);

CREATE TABLE races(
    stateid         VARCHAR(4),
    name            VARCHAR(64),
    votes           INTEGER,
    absenteevotes   INTEGER,
    electoralvotes  INTEGER,
    rating          VARCHAR(32),
    candidates      TEXT,
    eligible        TEXT,
    agesource       TEXT
);

CREATE TABLE state(
    stateid         VARCHAR(4),
    name            VARCHAR(64),
    admitted        VARCHAR(10),
    capital         VARCHAR(32),
    population      INTEGER,
    timezone        VARCHAR(32),
    timezoneurl     VARCHAR(64),
    medianincome    INTEGER,
    seal            TEXT,
    flag            TEXT
);


